import './App.css';

function App() {
  return (
    <div className="App">
      <link rel="stylesheet" href="https://use.typekit.net/lll4eml.css"></link>

      <header className="App-header">
        <p className="title">TrackTheSpot</p>
      </header>
    </div>
  );
}

export default App;
